import './App.css';
import Header from './components/header/Header';
import image from './images/main-head.jpg';
import NavButton from './components/buttons/NavButton';

function App() {
  return (
    <div>
    <NavButton 
      value="Aktualności"
      />
    <Header
      src={image}
      text="SPR BOR Oborniki Śląskie"
      />
    </div>
  );
}

export default App;
